import React, { Component } from 'react';

class Product extends Component {
	constructor(props) {
		
	}
	render() {
		return (
			<>
				<p>Each {props.name} costs ${props.price}</p>
				<p>{props.children}</p>
				<hr/>
			</>
		)
	}
}

export default Product;
